import { useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import sucessgif from '../../assets/img/icons8-sucesso.gif';
import errogif from '../../assets/img/icons8-erro.gif';

export function Register() {
  const [gestorName, setGestorName] = useState('');
  const [password, setPassword] = useState('');
  const [nameCompany, setNameCompany] = useState('');
  const [email, setEmail] = useState('');
  const [province, setProvince] = useState('');
  const [streetAddress, setStreetAddress] = useState('');
  const [nifEmpresa, setNifEmpresa] = useState('');
  const [actuacao, setActuacao] = useState('');
  const [telefone, setTelefone] = useState('');
  const [showSuccessModal, setShowSuccessModal] = useState(false);
  const [showErrorModal, setShowErrorModal] = useState(false);

  const handleCloseSuccessModal = () => setShowSuccessModal(false);
  const handleCloseErrorModal = () => setShowErrorModal(false);

  const handleRegister = (e) => {
    e.preventDefault();

    const user = {
      gestorName,
      password,
      nameCompany,
      email,
      province,
      streetAddress,
      nifEmpresa,
      actuacao,
      telefone
    };

    axios.post('http://localhost:3001/register', user)
      .then(response => {
        setShowSuccessModal(true);
        setTimeout(() => {
          setShowSuccessModal(false);
          // Aqui você pode redirecionar para a página de login ou fazer outra ação após o registro
        }, 3000); // Fecha o modal após 3 segundos
      })
      .catch(error => {
        setShowErrorModal(true);
        setTimeout(() => {
          setShowErrorModal(false);
        }, 2000); // Fecha o modal de erro após 2 segundos
      });
  };

  return (
    <>
      <section className="containerLogin">
        <div className="flex min-h-full flex-1 flex-col justify-center px-6 py-12 lg:px-8 bg-gray-900 opacity-90">
          <div className="max-w-3xl mx-auto px-4">
            <div className="flex min-h-full flex-1 flex-col justify-center px-6 py-12 lg:px-8">
              <div className="mt-10 sm:mx-auto sm:w-full">
                <form onSubmit={handleRegister}>
                  <div className="space-y-12">
                    <div className="border-b border-gray-900/10 pb-12">
                      <h1 className="text-base font-semibold leading-7 text-white">Faça o Registro da sua conta</h1>
                      <p className="mt-1 text-sm leading-6 text-white">Por favor, use um endereço permanente onde você possa receber as correspondências.</p>
                      <div className="mt-10 grid grid-cols-1 gap-x-6 gap-y-8 sm:grid-cols-6">
                        {/* Inputs e labels omitidos para brevidade */}
                      </div>
                    </div>
                    <div className="mt-6 flex items-center justify-end gap-x-6">
                      <Link to="/" className="text-sm font-semibold leading-6 text-white hover:text-gray-300">Cancelar</Link>
                      <button type="submit" className="rounded-md bg-indigo-600 px-3 py-2 text-sm font-semibold text-white shadow-sm hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600">Guardar</button>
                    </div>
                  </div>
                </form>
                <p className="mt-10 text-center text-sm text-white">
                  Já tens uma conta?{' '}
                  <Link to="/" className="font-semibold leading-6 text-indigo-600 hover:text-indigo-500">Entre</Link>
                </p>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Modal de Sucesso */}
      {showSuccessModal &&
        <div className="fixed inset-0 z-50 flex items-center justify-center overflow-x-hidden overflow-y-auto bg-gray-900 bg-opacity-50">
          <div className="bg-white p-6 rounded-lg shadow-lg flex flex-col items-center">
            <img src={sucessgif} alt="Sucesso" />
            <p className="text-lg text-gray-900">Registro bem-sucedido!</p>
          </div>
        </div>
      }

      {/* Modal de Erro */}
      {showErrorModal &&
        <div className="fixed inset-0 z-50 flex items-center justify-center overflow-x-hidden overflow-y-auto bg-gray-900 bg-opacity-50">
          <div className="bg-white p-6 rounded-lg shadow-lg flex flex-col items-center">
            <img src={errogif} alt="Erro" />
            <p className="text-lg text-gray-900">Erro ao registrar. Verifique os dados inseridos.</p>
          </div>
        </div>
      }
    </>
  );
}
